import React from "react";
import {Link} from "react-router-dom";
import "./Header.css";
function Header(){
    // function openCompiler(){
    //     <iframe src="https://trinket.io/embed/java/c861f92d30" width="100%" height="356" frameborder="0" marginwidth="0" marginheight="0" allowfullscreen></iframe>
    // }
    return(
        <div class="header">
            <div class="leftside">
                <h1>Learncode</h1>
                <input type="text" placeholder="Search..." />
                <button class="search">Search</button>
                <Link to="top"><button class="compiler">Compiler</button></Link>
                <button class="signin">Login</button>
                <button class="signout">Logout</button>
            </div> 
            <div className="rightside">

            </div>          
        </div>

    );
}
export default Header;
